const API_BASE_URL = process.env.REACT_APP_API_URL || "http://localhost:8000/api"

class ApiService {
  private baseURL: string
  private token: string | null

  constructor() {
    this.baseURL = API_BASE_URL
    this.token = localStorage.getItem("token")
  }

  private async request<T>(endpoint: string, options: RequestInit = {}): Promise<T> {
    const url = `${this.baseURL}${endpoint}`
    const headers: Record<string, string> = {
      "Content-Type": "application/json",
    }

    if (this.token) {
      headers["Authorization"] = `Bearer ${this.token}`
    }

    if (options.headers) {
      Object.assign(headers, options.headers)
    }

    const response = await fetch(url, {
      ...options,
      headers,
    })

    if (!response.ok) {
      const error = await response.json().catch(() => ({ message: "Network error" }))
      throw new Error(error.message || `HTTP error! status: ${response.status}`)
    }

    return response.json()
  }

  setToken(token: string | null) {
    this.token = token
    if (token) {
      localStorage.setItem("token", token)
    } else {
      localStorage.removeItem("token")
    }
  }

  // Auth endpoints
  async login(credentials: { email: string; password: string }) {
    return this.request("/auth/login/", {
      method: "POST",
      body: JSON.stringify(credentials),
    })
  }

  async register(userData: { first_name: string; last_name: string; email: string; password: string }) {
    return this.request("/auth/register/", {
      method: "POST",
      body: JSON.stringify(userData),
    })
  }

  async getProfile() {
    return this.request("/auth/profile/")
  }

  async updateProfile(data: any) {
    return this.request("/auth/profile/", {
      method: "PATCH",
      body: JSON.stringify(data),
    })
  }

  // Skills endpoints
  async getSkills(params?: any) {
    const queryString = params ? new URLSearchParams(params).toString() : ""
    return this.request(`/skills/${queryString ? `?${queryString}` : ""}`)
  }

  async getSkill(id: number) {
    return this.request(`/skills/${id}/`)
  }

  async createSkill(data: any) {
    return this.request("/skills/", {
      method: "POST",
      body: JSON.stringify(data),
    })
  }

  async updateSkill(id: number, data: any) {
    return this.request(`/skills/${id}/`, {
      method: "PATCH",
      body: JSON.stringify(data),
    })
  }

  async deleteSkill(id: number) {
    return this.request(`/skills/${id}/`, {
      method: "DELETE",
    })
  }

  async getCategories() {
    return this.request("/skills/categories/")
  }

  // Points endpoints
  async getPackages() {
    return this.request("/points/packages/")
  }

  async purchasePackage(packageId: number) {
    return this.request("/points/purchase/", {
      method: "POST",
      body: JSON.stringify({ package_id: packageId }),
    })
  }

  async getTransactions() {
    return this.request("/points/transactions/")
  }

  async createOrder(skillId: number) {
    return this.request("/points/orders/", {
      method: "POST",
      body: JSON.stringify({ skill_id: skillId }),
    })
  }

  async getOrders() {
    return this.request("/points/orders/")
  }

  // Payments endpoints
  async getPaymentHistory() {
    return this.request("/payments/history/")
  }

  async createPayment(data: any) {
    return this.request("/payments/", {
      method: "POST",
      body: JSON.stringify(data),
    })
  }

  // Chat endpoints
  async getRooms() {
    return this.request("/chat/rooms/")
  }

  async getRoom(id: number) {
    return this.request(`/chat/rooms/${id}/`)
  }

  async getMessages(roomId: number) {
    return this.request(`/chat/rooms/${roomId}/messages/`)
  }

  async sendMessage(roomId: number, message: string) {
    return this.request(`/chat/rooms/${roomId}/messages/`, {
      method: "POST",
      body: JSON.stringify({ message }),
    })
  }

  async createRoom(participantId: number, skillId?: number) {
    return this.request("/chat/rooms/", {
      method: "POST",
      body: JSON.stringify({
        participant_id: participantId,
        skill_id: skillId,
      }),
    })
  }
}

const api = new ApiService()

// Export individual API modules
export const authAPI = {
  login: api.login.bind(api),
  register: api.register.bind(api),
  getProfile: api.getProfile.bind(api),
  updateProfile: api.updateProfile.bind(api),
}

export const skillsAPI = {
  getSkills: api.getSkills.bind(api),
  getSkill: api.getSkill.bind(api),
  createSkill: api.createSkill.bind(api),
  updateSkill: api.updateSkill.bind(api),
  deleteSkill: api.deleteSkill.bind(api),
  getCategories: api.getCategories.bind(api),
}

export const pointsAPI = {
  getPackages: api.getPackages.bind(api),
  purchasePackage: api.purchasePackage.bind(api),
  purchasePoints: api.purchasePackage.bind(api), // Alias
  getTransactions: api.getTransactions.bind(api),
  createOrder: api.createOrder.bind(api),
  getOrders: api.getOrders.bind(api),
}

export const paymentsAPI = {
  getPaymentHistory: api.getPaymentHistory.bind(api),
  createPayment: api.createPayment.bind(api),
}

export const chatAPI = {
  getRooms: api.getRooms.bind(api),
  getRoom: api.getRoom.bind(api),
  getMessages: api.getMessages.bind(api),
  sendMessage: api.sendMessage.bind(api),
  createRoom: api.createRoom.bind(api),
}

export default api
